import Vue from 'vue'
// import ElementUI from 'element-ui'
import App from './App.vue'
import VueRouter from 'vue-router'
//引入路由器
import router from './router'

Vue.config.productionTip = false
Vue.use(VueRouter)
// 
new Vue({
  // 完成了将APP组件放入容器中
  render: h => h(App),
  router:router
}).$mount('#app')
